import React, { useEffect, useState } from "react";
import Repas from "../components/Repas";
import NavBar from "../components/NavBar";
import backImg from "../assets/img/repas-back.png";
import { Link } from "react-router-dom";
import axios from "axios";
const FicheRepas = () => {
  window.scrollTo(0, 0);

  return (
    <>
      <NavBar />
      <div>
        <div className="preambule-content">
          <div className="content-title">
            <h2>Fiche Repas</h2>
          </div>
        </div>
        <div>
          <section>
            <div className="preambule-content-profile">
              <div className="content-form">
                <form>
                  <div className="recipe">
                    <table>
                      <th>Nom</th>
                      <tr>Ingredient</tr>
                    </table>
                  </div>
                </form>
              </div>
            </div>
          </section>
        </div>

        <div className="img-back-bottom">
          <img src={backImg} alt="" />
        </div>
      </div>
    </>
  );
};

export default FicheRepas;
